column8:
庭の水まきに『いちご』なんて楽しいでしょう。<br>吐水口にホーセンドでホースを接続できます。<br><img src="http://image.rakuten.co.jp/select-tool/cabinet/kakudai/733-800zu2.jpg"><br>壁から吐水口までの長さ：50mm　高さ127mm<BR><BR>
●固定コマ仕様(一般地・寒冷地共用) <BR>
●吐水口にホーセンドが接続できます。 <BR>
●整流器付き <BR>
<BR>
